import tkinter as tk
import webbrowser
import urllib.request
import urllib.error
import urllib.parse
from bs4 import BeautifulSoup
from base64 import b64decode
import sys
import os

def convert_image_to_video(image_url):
    debug_mode = [False, True]
    static_part, dynamic_part = image_url.rsplit('/', 1)
    filename_part = dynamic_part[:11]
    qualities = ["original", "1080p", "720p", "480p", "360p", "240p", "144p"]
    for debug_yon in debug_mode:
        for quality in qualities:
            if debug_yon:
                if static_part.startswith("https://data-1.utreon.com/"):
                    static_part = static_part.replace("https://data-1.utreon.com/", "https://data-2.playeur.com/")
                elif static_part.startswith("https://data-2.playeur.com/"):
                    static_part = static_part.replace("https://data-2.playeur.com/", "https://data-1.utreon.com/")
            video_filename = f"{filename_part}_{quality}.mp4"
            video_url = f"{static_part}/{video_filename}"
            try:
                urllib.request.urlopen(video_url)
                return video_url
            except:
                pass
    return "Introuvable"

def convert_url_to_image(url):
    response = urllib.request.urlopen(url)
    html = response.read()
    response.close()
    soup = BeautifulSoup(html, 'html.parser')
    picture = soup.find("picture", class_="video-preview-img")
    image = picture.find("img")['src']
    official_title = picture.find("img")['alt']
    special_characters = '/\\*?\"<>|'
    for char in special_characters:
        official_title = official_title.replace(char, ' ')
    return [official_title, image]
    


def title_to_url(title):
    good_title = urllib.parse.quote(title)
    url = "https://playeur.com/search?q="+good_title
    return url
    

def convert_and_display():
    title_str = entry_title.get()
    try:
        video_url = convert_image_to_video(convert_url_to_image(title_to_url(title_str))[1])
        result_var.set(video_url)
    except:
        result_var.set("Introuvable")

def open_in_browser():
    webbrowser.open(result_var.get())

icon_data = ""

